import { QuestionContent } from "../QuestionContent/QuestionContent";
import "./GenderContent.scss";

export const GenderContent = () => {
  const contentArr = [
    "What gender do you identify with?",
    "Please share how do you identify yourself",
  ];

  const genderArr = [
    {
      type: "Female",
      icon: "../../assets/icons/female.svg",
    },
    {
      type: "Male",
      icon: "../../assets/icons/male.svg",
    },
    {
      type: "Other",
      icon: "../../assets/icons/other.svg",
    },
  ];

  return (
    <div className="genderContentContainer">
      <QuestionContent content={contentArr} />

      <ul className="listOfOption"></ul>
    </div>
  );
};
